import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <p>Welcome to the Ecommerce Portal Dashboard!</p>
      <nav>
        <ul>
          <li><Link to="/invoices">Go to Invoice Portal</Link></li>
          <li><Link to="/products">Go to Product Management</Link></li>
          <li><Link to="/login">Store Login</Link></li>
        </ul>
      </nav>
    </div>
  );
};

export default Dashboard;
